import React from 'react'
import UserInfo from '../components/UserInfo';
import styled from 'styled-components'
import RegisterDirect from 'user/components/RegisterDirect';

const Login = () => (
<div>
    <h1>로그인</h1>
    <form style={{width:"100%"}}>
                        
                <label for="id">아이디 : </label>                
                <input type="text" id="id" /><br/><br/>
            
                <label for="pw">비밀번호 : </label>
                <input type="password" id="pw" /><br/>
                {/* separate instance where input is wrong */}
                {/* <Wrong/> */}
                
                <br/><input type="submit" title="로그인" value="로그인" />            
    </form><br/><br/><br/>
    <a href={RegisterDirect} target="_blank" onclick={window.open(RegisterDirect)}><input type="submit" title="회원 가입" value="회원 가입" /></a><br/>
    <input type="submit" title="인증서 가입" value="인증서 가입"/>
    <input type="button" title="인증서 로그인" value="인증서 로그인" /><br/>
    <input type="button" title="SNS 로그인" value=" 로그인" /><br/>
    <input type="button" title="ID/PW 찾기" value="ID/PW 찾기" /><br/> 
    
</div>
)
export default Login;

